var Segundos;
var TimerUpdate;

function TratarTimerAtualizacao() {
    Segundos = 0;
    TimerUpdate = setInterval(function () {
        if (Segundos == 0) {
            clearInterval(TimerUpdate);  
            LimparGrideAcao();
        } else {
            document.getElementById("lblAtualizando").innerHTML = (`Atualizando em <b>${Segundos.toString()}s<b/>`);
            Segundos--;
        }
    }, 1000);         
}

